import React from 'react';
import logo from './logo.svg';
import './App.css';
import Login from './Login'
import Core from './Core';

class App extends React.Component {
  state = {
    isAuthenticated: false,
    authToken: null,
  }
  render(){
    <Provider value={this.state}>
      <Login />
      <Core />
    </Provider>
  }


}

export default App;
